import React from 'react';
import 'styles.css'

function Cabecalho() {
  
  return (

        <div className="App">
            <header className="Cabecalho">              
                CABECALHO DO SISTEMA
            </header>
            <a href='/home'>Home</a>  
            <a href='/contatos'>Contatos</a>         
        </div>          
  );
}

export default Cabecalho;
